import React from 'react';
import '../css/Filter.css';


const Filter = ({ data, clickHandler }) => {

	return (
		<div className='Filter--comp'>
			{
				data.map((filter, index) => {
					return (
						<li key={index} className={filter.selected ? 'filter__list--item selected' : 'filter__list--item'} onClick={(e) => clickHandler(e, index)}>{filter.label}</li>
					);
				})
			}
		</div>
	);
};

export default Filter;
